                    // Backwards compatibility with v1.x
                    var buttons = [];
                    
                    for (var key in compButtons) {
                        var index = '_' + key;

                        if (!compButtons[key]) {
                            buttons[index] = globButtons[index];
                        } else {
                            buttons[index] = {
                                buttonText: compButtons[key],
                                ariaLabel: compButtons[key]
                            };
                        }
                    }
                    
